 @Nechayev_Mikhail  O cara tem "só" mais de 400 gols na carreira e umas 230 assistências.
Isso dá uma média de tipo 0,7 participação em gol/jogo.
Se isso não significar ser craque, não sei mais o que significa...

Que ano!
Melhor Série B dos últimos tempos, super disputada;
Série A disputadíssima (uma das melhores, pelo menos dos pontos corridos), com meu Galo podendo ser campeão;
Flu campeão da Libertadores;
City campeão da Champions;
São Paulo campeão da Copa do Brasil;
Um monte de cheirinho do Mingau;
Vitória campeão da B

Oq faltou? Lembrando q é minha opinião
